import { Component } from "react";
import Link from 'next/link'
class Index extends Component {
    constructor(props) {
        super(props)
    }
    render () {
        return (
            <div>
            <Link href="/about">
              <a>About Page</a>
            </Link>
            <p>Hello Next.js</p>
          </div>
        )
    }
}

export default Index;
